 import React from "react";
 import product_cart from "../data/product_data";
import Box from '@mui/material/Box';
import './mainproduct.css';

const Mainproduct = () => {
const listItem=product_cart.map((item)=>
<Box className="cart">
  
<Box className="cart_img"  >
<img src={item.thumb} alt="Logo" style={{ height: '40%',width:'25%', margin: '10px', flexGrow: 2 }} />
</Box>

<div className="text">
<h3>{item.name}</h3>
</div>
<div className="description">
<p>{item.description}</p>
</div>
<p className="price">{item.real_price}</p>



</Box>
 );
return (
  
<Box className="main_content" >
 {listItem}
</Box>
     
      
  
);
}

 export default  Mainproduct;
